import './../style/main.css';
import './../style/font-awesome.min.css'
import './../style/traduler.css';
import { useLocation, useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";


function Header() {

    let navigate = useNavigate();
    let [user, setUser] = useState([]);

    let [toggle, setToggle] = useState(false);

    useEffect(() => {
        const ifUser = localStorage.getItem("userCookie");
        if (ifUser) {
            setUser(JSON.parse(ifUser));
        }
    }, []);

    const logoutBtn = () => {
        if (window.confirm("로그아웃 하시겠습니까?")) {
            localStorage.removeItem("userCookie")
            return navigate("/")
        }
    }

    const toggleMenu = () => {
        console.log("toggle : " , toggle)
        if(toggle === false){
            document.body.classList.add('is-menu-visible');
            setToggle(true);
        }else{
            document.body.classList.remove('is-menu-visible');
            setToggle(false)
        }



    }

    return (
        <div>
            <div className="wrapp">
                <div className='logo'>
                    <a href="" onClick={() => { navigate('/') }}>
                        <img src="images/traduler-logo-green.png" height="80px" />
                    </a>
                </div>
                <div>
                    <header id="header">
                        <nav>
                            <ul>
                                {
                                    user == '' || user == null
                                        ? <li ><a onClick={() => { navigate('/login') }}>LOGIN</a></li>
                                        : <li >{user.value} 님 방가^^!<a href='' onClick={() => { logoutBtn() }}>LOGOUT</a></li>
                                }

                                {/* <li ><a href="" onClick={ () => {navigate('/myPageMenu') }}>MY TRADULE</a></li> */}
                                <li ><a href='#menu' onClick={() => {  toggleMenu() }}>Menu</a></li>

                            </ul>
                        </nav>
                    </header>
                    <nav id="menu">
                        <div className='inner'>
                        <h2>Menu</h2>
                        <br/>
                        <ul>
                            <li><a >Home</a></li>
                            <li><a >My Page</a></li>
                            <li><a >Login / Register</a></li>
                            <li><a >Logout</a></li>
                            <li><a>Review</a></li>
                            <li><a >QnA</a></li>
                            <li><h2>로그인을 한 후 나만의 리스트를 만들어보세요!</h2> </li>
                            <li>
                                <h2>[나의 여행 리스트 후보]</h2>
                                <div id="replyList"></div>
                            </li>
                        </ul>
                        </div>
                        <a className='close' onClick={() => { toggleMenu() }}> Close  </a>
                    </nav>



                </div>
            </div>

        </div>
    )
}
export default Header;
